package fr.creasport.webgestionstock.metier;

import java.util.List;

public class Famille {
	
	private int fa_id;
	private String fa_code;
	private String fa_nom;

	public Famille() {
		// TODO Auto-generated constructor stub
	}

	public int getFa_id() {
		return fa_id;
	}

	public void setFa_id(int fa_id) {
		this.fa_id = fa_id;
	}

	public String getFa_code() {
		return fa_code;
	}

	public void setFa_code(String fa_code) {
		this.fa_code = fa_code;
	}

	public String getFa_nom() {
		return fa_nom;
	}

	public void setFa_nom(String fa_nom) {
		this.fa_nom = fa_nom;
	}
	


}
